insert  into `fish_event`(`id`,`date`,`name`,`description`,`rules`,`users`,`location_id`,`fish_event_type_id`,`created_at`,`updated_at`,`created_by`,`updated_by`) values (1,'2011-05-18','ВЛЖСКИЙ ТРФЕЙ 2011','<p><span style=\"color: black;\"><span style=\"font-family: Verdana;\">База Золотые пески</span><span style=\"font-family: Verdana;\"> <span style=\"font-family: Verdana;\">расположена</span> <span style=\"font-family: Verdana;\">на правом берегу Волги</span> <span style=\"font-family: Verdana;\">в Енотаевском районе Астраханской области, близ села Замьяны.</span> <span style=\"font-family: Verdana;\">НА 1321 км.</span><span style=\"font-family: Verdana;\"> ФЕДЕРАЛЬНОЙ ТРАССЫ</span> <span style=\"font-family: Verdana;\">М-6.</span> </span></span><span style=\"font-family: Verdana;\"><span style=\"color: black;\">Трофейная ловля &ndash; сома, сазана, жереха, судака, щуки, окуня, леща, линя и буфало. </span></span><br /> </p>\r\n<div align=\"center\"><span style=\"font-family: Verdana;\"><span style=\"color: darkred;\"><span style=\"font-family: Comic Sans MS;\"><span style=\"font-size: small;\"><span style=\"color: #000080;\">Наше ВИДЕО с <span style=\"font-size: medium;\">Фестивалей</span>!</span></span></span></span></span><br /> <span style=\"font-family: Verdana;\"><span style=\"color: darkred;\"><a href=\"http://avtobus.rusfishing.ru/video/73-video-rybalka-s-radzishevskim-festival-kluba.html\" target=\"_blank\"><span style=\"color: #22229c;\">http://avtobus.rusfishing.ru/video/7...val-kluba.html</span></a></span></span></div>\r\n<p>&nbsp;</p>\r\n<div align=\"center\"><span style=\"color: darkred;\"><span style=\"font-family: Verdana;\"><span style=\"color: #8b0000;\">Рыболовные ПУТЕШЕСТВИЯ <span style=\"font-family: Comic Sans MS;\"><span style=\"font-size: small;\"><span style=\"color: #000080;\">\"Вместе на РЫБАЛКУ\"!</span></span></span></span></span></span><br /> <span style=\"font-family: Verdana;\"><span style=\"font-family: Verdana;\"><span style=\"color: #22229c;\"><a href=\"http://avtobus.rusfishing.ru/\" target=\"_blank\">http://avtobus.rusfishing.ru/</a></span></span></span></div>\r\n<p>&nbsp;</p>\r\n<div align=\"center\"><span style=\"font-family: Verdana;\"><span style=\"font-size: small;\"><span style=\"color: red;\">Открыта запись на участие в Фестивале!</span></span></span></div>\r\n<p><br /> <span style=\"color: black;\"><span style=\"font-family: Verdana;\">Принять участие в Фестивале могут не только </span><span style=\"font-family: Verdana;\">члены Клуба</span><span style=\"font-family: Verdana;\">, но и Ваши родственники, друзья, знакомые! Присоединяйтесь к нашему Дружному коллективу!</span></span></p>\r\n<div align=\"center\"><span style=\"font-family: Verdana;\"><span style=\"font-size: small;\"><span style=\"color: red;\">Вариант №1</span></span></span></div>\r\n<p><br /> <span style=\"font-family: Verdana;\"><span style=\"color: black;\">Приезд на базу на личном транспорте;</span></span><br /> <span style=\"font-family: Verdana;\"><span style=\"color: black;\">(Заезд на базу 02.07 после 14.00 час., выезд с базы 09.07 в 12.00 час.)</span></span><br /> <br /> <span style=\"font-family: Verdana;\"><span style=\"color: black;\">Стоимость участия :</span></span><br /> <span style=\"color: black;\"><span style=\"font-family: Verdana;\">-<span style=\"color: red;\">8000</span></span><span style=\"font-family: Verdana;\"><span style=\"color: red;\"> рублей</span></span><span style=\"font-family: Verdana;\"> (проживание на базе в период проведения Фестиваля = 7 суток ) </span></span><br /> <span style=\"color: black;\"><span style=\"font-family: Verdana;\">-</span><span style=\"font-family: Verdana;\"><span style=\"color: red;\">500 рублей</span></span><span style=\"font-family: Verdana;\"> Регистрационный взнос Фестиваля с участника </span></span><br /> <span style=\"font-family: Verdana;\"><span style=\"color: black;\">(Участие в мероприятии организованным клубом. Праздничный фуршет посвящённый закрытию Фестиваля!)</span></span><br /> <span style=\"font-family: Verdana;\"><span style=\"color: red;\">От регистрационных взносов(500 руб) освобождаются:</span></span><br /> <span style=\"font-family: Verdana;\"><span style=\"color: black;\">- Дети до 16 лет.</span></span><br /> <span style=\"font-family: Verdana;\"><span style=\"color: black;\">- Ветераны ВОВ.</span></span><br /> Дети до 12 лет проживание на базе на дополнительном месте-<span style=\"text-decoration: underline;\"><span style=\"color: red;\">БЕСПЛАТНО</span></span><br /> </p>\r\n<div align=\"center\"><span style=\"font-family: Verdana;\"><span style=\"font-size: small;\"><span style=\"color: red;\">Вариант №2</span></span></span></div>\r\n<p><br /> <span style=\"color: black;\"><span style=\"font-family: Verdana;\">Традиционный </span><span style=\"font-family: Verdana;\"><span style=\"color: red;\">Клубный Автобус!</span></span><span style=\"font-family: Verdana;\"> (Доставка участников Москва-База-Москва)</span></span><br /> <span style=\"color: black;\"><span style=\"font-family: Verdana;\">Кол-во мест в автобусе = </span><span style=\"font-family: Verdana;\">45 человек</span><span style=\"font-family: Verdana;\">.</span></span><br /> <br /> <span style=\"font-family: Verdana;\"><span style=\"color: black;\">Стоимость участия :</span></span><br /> <span style=\"color: black;\"><span style=\"font-family: Verdana;\">-</span><span style=\"font-family: Verdana;\"><span style=\"color: red;\">10500 рублей</span></span><span style=\"font-family: Verdana;\"> ( проезд в автобусе туда и обратно, проживание на базе в период проведения Фестиваля)</span></span><br /> <span style=\"color: black;\"><span style=\"font-family: Verdana;\">-</span><span style=\"font-family: Verdana;\"><span style=\"color: red;\">500 рублей</span></span><span style=\"font-family: Verdana;\"> Регистрационный взнос Фестиваля с участника </span></span><br /> <span style=\"font-family: Verdana;\"><span style=\"color: black;\">(Участие в мероприятии организованным клубом. Праздничный фуршет посвящённый закрытию Фестиваля!)</span></span><br /> <span style=\"font-family: Verdana;\"><span style=\"color: red;\">От регистрационных взносов(500 руб) освобождаются:</span></span><br /> <span style=\"font-family: Verdana;\"><span style=\"color: black;\">- Дети до 16 лет.</span></span><br /> <span style=\"font-family: Verdana;\"><span style=\"color: black;\">- Ветераны ВОВ.</span></span><br /> <span style=\"font-family: Verdana;\"><span style=\"color: black;\">-Дети до 12 лет Скидка 80% (проезд в автобусе на основном месте, проживание на базе на дополнительном месте)</span></span><br /> </p>\r\n<div align=\"center\"><span style=\"color: red;\"><span style=\"font-family: Verdana;\">Место сбора и отправления автобуса;</span></span><br /> <span style=\"text-decoration: underline;\"><span style=\"font-family: Verdana;\"><span style=\"color: #22229c;\"><a href=\"http://maps.yandex.ru/moscow?upoint=77094167669f\" target=\"_blank\">http://maps.yandex.ru/moscow?upoint=77094167669f</a></span></span></span><br /> <span style=\"color: black;\"><span style=\"font-family: Verdana;\">м.ОРЕХОВО(метро-посл.вагон из центра, </span><span style=\"font-family: Verdana;\">выход к площадке автобусного круга</span><span style=\"font-family: Verdana;\">.</span><span style=\"font-family: Verdana;\">ВНИМАНИЕ!</span><span style=\"font-family: Verdana;\"> м.Орехово-2выхода)</span><span style=\"font-family: Verdana;\">. </span></span><br /> <span style=\"font-size: small;\"><span style=\"color: black;\"><span style=\"font-family: Verdana;\"><span style=\"color: red;\">Сбор к </span></span><span style=\"font-family: Verdana;\"><span style=\"color: red;\">21.00 час</span> (<span style=\"color: red;\">01.07.11</span>) </span></span></span><br /> <span style=\"font-size: small;\"><span style=\"color: red;\"><span style=\"font-family: Verdana;\">Старт 22.00 часов</span></span></span><br /> <span style=\"color: black;\"><span style=\"font-family: Verdana;\">Возвращение в Москву(на место старта)10.07.11 (прибытие примерно в</span><span style=\"font-family: Verdana;\"> 15.00час.)</span></span></div>\r\n<p><br /> </p>\r\n<div align=\"center\"><span style=\"font-family: Verdana;\"><span style=\"font-size: small;\"><span style=\"color: blue;\">Дополнительная информация!</span></span></span></div>\r\n<p><br /> <span style=\"color: red;\">На территории Базы организован песчанный пляж для купания и отдыха, прокат шезлонгов, зонтиков, бесплатная \"таблетка\" для катания на воде, бесплатный теннисный стол и многое другое, что позволит отлично провести Ваш отдых в летний период!</span><br /> <span style=\"font-family: Verdana;\"><span style=\"color: black;\">Питание в кафе круглосуточное!</span></span><br /> <span style=\"color: black;\"><span style=\"font-family: Times New Roman;\"><span style=\"font-size: small;\">На территории Базы работает кафе, где Вас ждет теплая, уютная обстановка, улыбки персонала и </span></span><span style=\"font-family: Verdana;\">большой ассортимент</span><span style=\"font-family: Times New Roman;\"><span style=\"font-size: small;\"> вкусных и любимых блюд: горячие и холодные закуски, первые и вторые блюда, десерты. выпечка, мороженое. </span></span><span style=\"font-family: Verdana;\">Средняя цена за полноценное 3-х разовое питание от 700 рублей. В</span><span style=\"font-family: Verdana;\">т.ч.завтрак -</span><span style=\"font-family: Verdana;\">ок.150руб, обед - ок.250-300руб., ужин ок.250руб.</span><span style=\"font-family: Times New Roman;\"><span style=\"font-size: small;\">В кафе представлен </span></span><span style=\"font-family: Verdana;\">широкий выбор</span><span style=\"font-family: Times New Roman;\"><span style=\"font-size: small;\"> напитков, разнообразных сортов пива, сигарет, соков и пр. По вашему желанию повара приготовят практически любое </span></span><span style=\"font-family: Verdana;\">блюдо на</span><span style=\"font-family: Verdana;\">заказ</span><span style=\"font-size: small;\"><span style=\"font-family: Times New Roman;\">, в том числе и </span></span><span style=\"font-family: Verdana;\">из Ваших трофеев. </span></span><br /> <span style=\"font-size: small;\"><span style=\"font-family: Times New Roman;\"><span style=\"color: black;\">Дополнительные услуги;</span></span></span><br /> <span style=\"font-family: Times New Roman;\"><span style=\"font-size: small;\"><span style=\"color: black;\">Баня, бильярд, коптильни (холодного и горячего копчения). Рыболовный отдел по продаже и аренде рыболовных снастей!</span></span></span><br /> <br /> <span style=\"font-family: Times New Roman;\"><span style=\"font-size: small;\"><span style=\"color: blue;\">ЛОДКИ <span style=\"font-size: x-small;\">(оплата за 6 дней)</span></span></span></span><br /> <br /> <span style=\"font-family: Times New Roman;\"><span style=\"color: black;\"><span style=\"text-decoration: underline;\">С мотором 15 л.с.: </span>стоимость </span><span style=\"color: red;\">800 руб/ световой день</span></span><br /> <br /> <span style=\"font-family: Times New Roman;\"><span style=\"color: black;\">Сава 420К пластик 8штук</span></span><br /> <span style=\"font-family: Times New Roman;\"><span style=\"color: black;\">Сава 425 пластик 6 штук</span></span><br /> <span style=\"font-family: Times New Roman;\"><span style=\"color: black;\">Крым 5 штук</span></span><br /> <span style=\"font-family: Times New Roman;\"><span style=\"color: black;\">Прогресс 2М 4 штуки</span></span><br /> <span style=\"font-family: Times New Roman;\"><span style=\"color: black;\">Казанка 5М 2штуки</span></span><br /> <br /> <span style=\"font-family: Times New Roman;\"><span style=\"color: black;\"><span style=\"text-decoration: underline;\">С мотором 40 л.с. и эхолотом</span> стоимость 1500 руб/ световой день</span></span><br /> <br /> <span style=\"font-family: Times New Roman;\"><span style=\"color: black;\">Казанка 5М4 3 штуки</span></span><br /> <br /> <span style=\"font-family: Times New Roman;\"><span style=\"color: red;\">Лодки бронируются мин.на два человека. При бронировании места , бронируйте лодку с указанием мотора!</span></span><br /> <br /> <span style=\"font-family: Times New Roman;\"><span style=\"font-size: small;\"><span style=\"color: black;\">Описание и фотографии домиков, кафе и территории смотрите на страничке &laquo;Фотографии&raquo;</span></span></span><br /> <span style=\"font-family: Times New Roman;\"><a href=\"http://www.gold-sand.ru/houses.php?file=Houses\" target=\"_blank\"><span style=\"color: blue;\">http://www.gold-sand.ru/houses.php?file=Houses</span></a></span><br /> </p>\r\n<div align=\"center\"><span style=\"font-family: Times New Roman;\"><span style=\"font-size: medium;\"><span style=\"color: blue;\">Контакты для бронирования мест:</span></span></span><br /> <span style=\"color: darkred;\"><span style=\"font-family: Verdana;\">Денисов Андрей Александрович </span><span style=\"font-family: Verdana;\">(МАРЛИН)</span></span><br /> <span style=\"font-family: Verdana;\"><span style=\"color: darkgreen;\">8.903-142-30*42</span></span><br /> <span style=\"color: darkred;\"><span style=\"font-family: Verdana;\">Микожанс Эрикс Владимирович </span><span style=\"font-family: Verdana;\">(ZHANS)</span></span><br /> <span style=\"font-family: Verdana;\"><span style=\"color: darkgreen;\">8.905-598-34*63</span></span></div>\r\n<p><br /> </p>\r\n<div align=\"center\"><span style=\"font-family: Verdana;\"><span style=\"font-size: small;\"><span style=\"color: red;\"><strong>ВНИМАНИЕ!</strong></span></span></span><br /> <span style=\"font-family: Verdana;\"><span style=\"color: red;\">До <span style=\"text-decoration: underline;\"><span style=\"font-size: medium;\">01 мая 2011г </span></span>необходимо сделать предоплату 100%. </span></span><br /> <span style=\"font-family: Verdana;\"><span style=\"color: red;\">Только в этом случае Ваше место будет считаться забронировано!</span></span></div>\r\n<p><br /> <span style=\"font-family: Verdana;\"><span style=\"color: black;\">К ВЫЕЗДУ МОЖНО ЗАКАЗАТЬ!</span></span><br /> <span style=\"font-family: Verdana;\"><span style=\"color: black;\">ЧЕРВЬ (1 банка) = 40 рублей</span></span><br /> <span style=\"font-family: Verdana;\"><span style=\"color: black;\">ОПАРЫШ (1 банка)= 30 рублей</span></span><br /> <span style=\"color: black;\"><span style=\"font-family: Verdana;\">Общий коллективный заказ будет доставлен на</span><span style=\"font-family: Verdana;\"> БАЗУ!</span></span></p>','<div align=\"left\"><span style=\"text-decoration: underline;\">1-й день</span> (02.07.) Заезд на базу.........<br /> С 14.00 часов (<span style=\"color: red;\">личный транспорт</span>), размещение, отдых.<br /> В 21.00 часов (<span style=\"color: red;\">автобус</span>), размещение, отдых.</div>\r\n<p><br /> <span style=\"text-decoration: underline;\">2-й день</span> (03.07.) &ndash; с 5.00 &ndash; Получение лодок, инструктаж по технике безопасности, знакомство с акваторией.<span style=\"color: red;\">15:00 &ndash;Торжественное Открытие Фестиваля! Старт Фестиваля!</span><br /> <br /> <span style=\"text-decoration: underline;\">3-й день</span> (04.07.) &ndash; Фестивалим!!!<img class=\"inlineimg\" title=\"Тащу\" src=\"http://www.rusfishing.ru/forum/images/smilies/5.gif\" alt=\"\" border=\"0\" /> <img class=\"inlineimg\" title=\"Друзья\" src=\"http://www.rusfishing.ru/forum/images/smilies/friends.gif\" alt=\"\" border=\"0\" /><img class=\"inlineimg\" title=\"Клево\" src=\"http://www.rusfishing.ru/forum/images/smilies/victory.gif\" alt=\"\" border=\"0\" /><br /> (рыбалка, отдых, общение единомышленников)<br /> <br /> <span style=\"text-decoration: underline;\">4-й день</span> (05.07.) &ndash; продолжаем Фестивалить<img class=\"inlineimg\" title=\"Друзья\" src=\"http://www.rusfishing.ru/forum/images/smilies/friends.gif\" alt=\"\" border=\"0\" /><img class=\"inlineimg\" title=\"Клево\" src=\"http://www.rusfishing.ru/forum/images/smilies/victory.gif\" alt=\"\" border=\"0\" /><img class=\"inlineimg\" title=\"Тащу\" src=\"http://www.rusfishing.ru/forum/images/smilies/5.gif\" alt=\"\" border=\"0\" /> <img class=\"inlineimg\" title=\"Улыбка\" src=\"http://www.rusfishing.ru/forum/images/smilies/smil.gif\" alt=\"\" border=\"0\" />!<br /> <br /> <span style=\"text-decoration: underline;\">5-й день</span> (06.07.) &ndash; продолжение Рыболовного Праздника<img class=\"inlineimg\" title=\"Тащу\" src=\"http://www.rusfishing.ru/forum/images/smilies/5.gif\" alt=\"\" border=\"0\" /><img class=\"inlineimg\" title=\"Друзья\" src=\"http://www.rusfishing.ru/forum/images/smilies/friends.gif\" alt=\"\" border=\"0\" />!<br /> <br /> <span style=\"text-decoration: underline;\">6-й день</span> (07.07.) &ndash; продолжение Рыболовного Праздника<img class=\"inlineimg\" title=\"Тащу\" src=\"http://www.rusfishing.ru/forum/images/smilies/5.gif\" alt=\"\" border=\"0\" /><img class=\"inlineimg\" title=\"Друзья\" src=\"http://www.rusfishing.ru/forum/images/smilies/friends.gif\" alt=\"\" border=\"0\" />!<br /> <br /> <span style=\"text-decoration: underline;\">7-й день</span> (08.07.) - последний день рыболовного турнира до 20.00 час.<br /> <span style=\"color: #ff0000;\">21.00 &ndash; подведение итогов Закрытие Фестиваля! </span><br /> <span style=\"color: #ff0000;\">Торжественое </span><span style=\"color: #ff0000;\">награждение победителей!!! 22.00 банкет!</span><br /> <br /> <span style=\"text-decoration: underline;\">8-й день</span> (09.07.) - свободный режим, отдых, рыбалка. <span style=\"color: red;\">В 12.00 выезд с базы.</span><br /> <br /> Информационная поддержка: <br /> <br /> -Центральный Форум Рыбаков. МОО Центральный рыболовный клуб <span style=\"color: blue;\"><span style=\"text-decoration: underline;\">\"RUSFISHING\"</span></span><br /> <br /> Форма проведения соревнований: <br /> -Соревнования проводятся в личном зачёте.<br /> <br /> Правила проведения Фестиваля:<br /> <br /> 1. Турнир проводится по следующим номинациям (личный зачёт);<br /> <br /> <strong><span style=\"color: blue;\">&middot;</span></strong> <span style=\"font-size: small;\"><span style=\"color: darkgreen;\">&laquo;Самая крупная стайная рыба&raquo; <span style=\"color: red;\">1,2,3 место</span></span></span><br /> <span style=\"font-size: small;\"><span style=\"color: darkgreen;\"><strong>&middot; </strong>&laquo;Самая крупная хищная рыба&raquo; </span><span style=\"color: red;\">1,2,3 место</span></span><br /> <span style=\"font-size: small;\"><span style=\"color: darkgreen;\"><strong>&middot; </strong>&laquo;Усатый гигант&raquo; </span><span style=\"color: red;\">1,2,3 место</span></span><br /> <span style=\"font-size: small;\"><span style=\"color: darkgreen;\"><strong>&middot;</strong> &laquo;Золотой Сазан&raquo; </span><span style=\"color: red;\">1,2,3 место</span></span><br /> <strong><span style=\"color: #0000ff;\">&middot;</span></strong><span style=\"font-size: medium;\"><span style=\"color: green;\">&laquo;Мой Волжский Трофей!&raquo;</span></span> <span style=\"color: red;\">Детская номинация</span> <img class=\"inlineimg\" title=\"Малыш\" src=\"http://www.rusfishing.ru/forum/images/smilies/sosa.gif\" alt=\"\" border=\"0\" /><br /> Проигравших у детей нет(в зачёт принемается вся рыба)<img class=\"inlineimg\" title=\"Улыбка\" src=\"http://www.rusfishing.ru/forum/images/smilies/smil.gif\" alt=\"\" border=\"0\" /><br /> <br /> 2. Один участник может принять участие во всех номинациях одновременно, но только на одно призовое место в каждой.<br /> 3. Победитель выявляется по наибольшему весу (на личное усмотрение) самой крупной рыбы. В случае если вес одинаковый у нескольких участников, победитель определяется по самому большому второму (третьему) экземпляру, предоставленному судейской бригаде (на взвешивание предоставляется до трёх рыб).<br /> 4. Регистрация улова возможна сразу по ходу проведения соревнований- 03, 04, 05<span style=\"color: black;\">, 06,07 и <span style=\"text-decoration: underline;\"><span style=\"color: red;\">08</span></span> </span>с 12.00 &ndash; 13.00 и с 21.30 - 22.30 кафе базы.<br /> 5. В зачет принимаются:<br /> -&laquo;Самая большая хищная рыба&raquo;: судак, щука, жерех, берш, язь, окунь. <span style=\"color: red;\">(за исключением сома)</span><br /> -&laquo;Самая крупная стайная рыба&raquo;: вся \"белая\" рыба: лещ, плотва, краснопёрка, густера, буфало, чехонь, и т.д<span style=\"color: red;\">.(сазан в зачёт не идёт!)</span><br /> -&laquo;Усатый гигант&raquo;: сом<br /> -&laquo;Золотой Сазан&raquo;: сазан <span style=\"color: red;\">(буфало в зачёт не идёт!).</span><br /> <br /> 6. В соревнованиях по &laquo;Стайной рыбе&raquo; можно использовать: поплавочные и донные снасти всех типов, количество прикормки не ограничено.<br /> 7. В соревнованиях по &laquo;Хищнику&raquo; - можно использовать блёсна всех типов, воблеры, снасточки, кружки, лов на дорожку (троллинг) с применением мускульной силы и мотора с использованием не более двух искусственных приманок.<br /> 8. В соревнованиях по &laquo;Усатому гиганту&raquo;- можно использовать снасти предусмотренные в п.6, п.7., и лов \"на квок\".<br /> 9. Места лова, в зависимости от предпочтения самого участника.<br /> 10. Все спорные вопросы решаются судейской бригадой.<br /> 11. <span style=\"color: red;\">Минимальный размер рыбы принимаемой в зачет (см.)</span><br /> <span style=\"color: blue;\">Жерех </span><span style=\"color: blue;\">32</span><br /> <span style=\"color: blue;\">Судак 40</span><br /> <span style=\"color: blue;\">Лещ 24</span><br /> <span style=\"color: blue;\">Щука 32</span><br /> <span style=\"color: blue;\">Сазан 40</span><br /> <span style=\"color: blue;\">Сом пресноводный 60</span><br /> <span style=\"color: blue;\">Вобла, плотва 17</span><br /> <span style=\"color: blue;\">Красноперка 17</span><br /> <span style=\"color: blue;\">Чехонь 22</span><br /> <span style=\"color: blue;\">Линь 22</span><br /> <br /> <span style=\"color: red;\"><span style=\"text-decoration: underline;\">Дополнительная информация. </span></span><br /> <br /> <span style=\"font-family: Times New Roman;\">В период проведения Фестиваля приглашаем всех участников на мастер-класс <img class=\"inlineimg\" title=\"Тащу\" src=\"http://www.rusfishing.ru/forum/images/smilies/5.gif\" alt=\"\" border=\"0\" /></span><br /> <span style=\"color: red;\"><span style=\"font-family: Times New Roman;\">&ldquo;</span><span style=\"font-family: Verdana;\">ОСНОВЫ УСПЕШНОЙ ЛОВЛИ СОМА!&rdquo;</span></span><br /> <br /> <span style=\"color: black;\"><span style=\"font-family: Verdana;\">ЦЕЛИ И ЗАДАЧИ ПРОВЕДЕНИЯ</span></span><span style=\"color: black;\"><span style=\"font-family: Verdana;\">&hellip;..</span></span><br /> <br /> <span style=\"color: black;\"><span style=\"font-family: Verdana;\">-РАЗРУШИТЬ СТЕРЕОТИП О СЛОЖНОСТИ ПОЗНАНИЙ ТЕХНОЛОГИИ ЛОВЛИ СОМА.</span></span><br /> <span style=\"color: black;\"><span style=\"font-family: Verdana;\">-ОБСУДИТЬ ПОДХОДЫ И РЕШЕНИЯ.</span></span><br /> <span style=\"color: black;\"><span style=\"font-family: Times New Roman;\">- </span></span><span style=\"color: black;\"><span style=\"font-family: Verdana;\">НАУЧИТЬ УЧАСТНИКА САМОСТОЯТЕЛЬНО ПРИГОТОВИТЬ СНАСТИ.</span></span><br /> <br /> <span style=\"font-family: Times New Roman;\">В программе мастер-класса&hellip;&hellip;..</span><br /> <br /> <span style=\"font-family: Times New Roman;\">-Общие рекомендации в подборе снастей для ловли сома с квоком.</span><br /> <span style=\"font-family: Times New Roman;\">-Общие рекомендации по ловле сома донной снастью.</span><br /> <span style=\"font-family: Times New Roman;\">-Советы по выбору удилища,катушки,лески.</span><br /> <span style=\"font-family: Times New Roman;\">-Подходы в выборе монтажа (применяемые грузила и крючки).</span><br /> <span style=\"font-family: Times New Roman;\">-Работа квока. Теория и демонстрация мастеров!</span><br /> <span style=\"font-family: Times New Roman;\">-Правильное вываживание сома.</span><br /> <span style=\"font-family: Times New Roman;\">-Как найти место и на что ловить?</span><br /> <span style=\"font-family: Times New Roman;\">-И ещё много интересного и увлекательного&hellip;&hellip;.</span><br /> <br /> <span style=\"font-family: Times New Roman;\">Мастер класс сотоится сразу после торжественного открытия Фестиваля. Проведёт мастер-класс известный егерь-сомятник, настоящий мастер своего дела</span><br /> <span style=\"font-family: Times New Roman;\"><span style=\"color: red;\">Владимир Велявин.</span></span></p>','<p><span style=\"font-family: Verdana;\"><span style=\"color: red;\"><strong><span style=\"text-decoration: underline;\">Автобус</span></strong></span></span><span style=\"font-family: Verdana;\">(38 мест)</span></p>\r\n<ol style=\"list-style-type: decimal;\"><ol style=\"list-style-type: decimal;\">\r\n<li><strong><span style=\"color: green;\">Марлин</span></strong></li>\r\n<li><strong><span style=\"color: green;\">Марлин+1(ж)</span></strong></li>\r\n<li><strong><span style=\"color: green;\">Марлин+1(реб)</span></strong></li>\r\n<li><strong><span style=\"color: green;\">Ёрш</span></strong></li>\r\n</ol></ol><span style=\"color: #008000;\">\r\n<ul>\r\n<li><strong><strong><span style=\"color: green;\">Ёрш+1</span></strong></strong></li>\r\n</ul>\r\n</span><ol style=\"list-style-type: decimal;\">\r\n<li><strong><span style=\"color: green;\">Саша1969</span></strong> <span style=\"color: #008000;\">оплата 16000</span></li>\r\n<li><span style=\"color: green;\"><strong>Илья Ильин </strong>оплата 10000</span></li>\r\n<li><span style=\"color: green;\"><strong>Илья Ильин+1 </strong>оплата 10000</span></li>\r\n<li><span style=\"color: green;\"><strong>Илья Ильин+1(ж) </strong>оплата 10000</span></li>\r\n<li><span style=\"color: green;\"><strong>Евгений 199 </strong>оплата 13400</span></li>\r\n<li><span style=\"color: green;\"><strong>Lomov </strong>оплата 15800</span></li>\r\n<li><span style=\"color: green;\"><strong>ser_g </strong>оплата 30000</span></li>\r\n<li><strong><span style=\"color: green;\">ser_g+1(ж)</span></strong></li>\r\n<li><strong><span style=\"color: green;\">ser_g+1(реб)</span></strong></li>\r\n<li><strong><span style=\"color: green;\">ser_g+1(реб)</span></strong></li>\r\n<li><strong><span style=\"color: green;\">ГОРДЕЕВ</span></strong> <span style=\"color: #008000;\">оплата 13500</span></li>\r\n<li><strong><span style=\"color: green;\">ГОРДЕЕВ + 1</span></strong> <span style=\"color: #008000;\">оплата 13500</span></li>\r\n<li><span style=\"color: green;\"><strong>Deniskin </strong>оплата 26550</span></li>\r\n<li><strong><span style=\"color: green;\">Deniskin+1(ж)</span></strong></li>\r\n<li><span style=\"color: green;\"><strong>Solor </strong>оплата 21800</span></li>\r\n<li><strong><span style=\"color: green;\">Solor+1</span></strong></li>\r\n<li><strong><span style=\"color: green;\">Серега спинингист</span></strong></li>\r\n<li><strong><span style=\"color: green;\">водитель</span></strong></li>\r\n<li><strong><span style=\"color: green;\">водитель2</span></strong></li>\r\n<li><strong><span style=\"color: green;\">оператор1</span></strong></li>\r\n<li><strong><span style=\"color: green;\">оператор2</span></strong></li>\r\n<li><strong><span style=\"color: green;\">Wild deer</span></strong></li>\r\n<li>Sergrybak</li>\r\n<li>Sergrybak+1</li>\r\n<li>Sergrybak+1(ж)</li>\r\n<li><strong><span style=\"color: green;\">Evgery</span></strong></li>\r\n<li><strong><span style=\"color: green;\">Evgery+1</span></strong></li>\r\n<li><strong><span style=\"color: green;\">Павел Седых</span></strong></li>\r\n<li><strong><span style=\"color: green;\">Павел Седых+1(ж)</span></strong></li>\r\n<li><strong><span style=\"color: green;\">Алексей Т.</span></strong></li>\r\n</ol>\r\n<p><span style=\"font-family: Verdana;\"></span><span style=\"font-family: Verdana;\"><span style=\"color: red;\"><strong><span style=\"text-decoration: underline;\">Личный транспорт</span> (35 мест)</strong></span></span><br /> </p>\r\n<ol style=\"list-style-type: decimal;\"><ol style=\"